// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";  // Make sure this is correct

// Import other components
// import RecipeList from "./Pages/RecipeList/RecipeList";  // Make sure this exists
// import RecipeDetail from "./Pages/RecipeDetail/RecipeDetail";  // Make sure this exists
// import Login from "./Pages/Login/Login";  // Make sure this exists
// import Register from "./Pages/Register/Register";  // Make sure this exists

import "./App.css";  

const App = () => {
  return (
    <Router>
      {/* Include the Navbar */}
      <Navbar /> 

      <Routes>
        {/* Define the homepage route */}
        <Route path="/" element={<h1>Welcome to Food Recipe Collection</h1>} />

        {/* Define the recipe list route */}
        <Route path="/recipes" element={<RecipeList />} />

        {/* Define the detailed recipe route */}
        <Route path="/recipe/:id" element={<RecipeDetail />} />

        {/* Define the login route */}
        <Route path="/login" element={<Login />} />

        {/* Define the register route */}
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
};

export default App;
